import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 63.2-1217 Provision of false information; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1217.md","filePath":"vacode/63.2-1217.md"}'),i={name:"vacode/63.2-1217.md"},n=t('<h1 id="§-63-2-1217-provision-of-false-information-penalty" tabindex="-1">§ 63.2-1217 Provision of false information; penalty. <a class="header-anchor" href="#§-63-2-1217-provision-of-false-information-penalty" aria-label="Permalink to &quot;§ 63.2-1217 Provision of false information; penalty.&quot;">​</a></h1><p>Any person who knowingly and intentionally provides false information in writing and under oath, which is material to an adoptive placement shall be guilty of a Class 6 felony. The Commissioner is authorized to investigate such cases and may refer the case to the attorney for the Commonwealth for prosecution.</p><p>1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0772" target="_blank" rel="noreferrer">772</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0826" target="_blank" rel="noreferrer">826</a>, § 63.1-220.6; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.24; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),r=[n];function l(s,f,c,p,_,h){return a(),o("div",null,r)}const m=e(i,[["render",l]]);export{g as __pageData,m as default};
